create table spells_templates
(
    Id                   int          not null
        primary key,
    NameId               int unsigned not null,
    DescriptionId        int unsigned not null,
    TypeId               int unsigned not null,
    ScriptParams         mediumtext   not null,
    ScriptParamsCritical mediumtext   not null,
    ScriptId             int          not null,
    ScriptIdCritical     int          not null,
    IconId               int          not null,
    SpellLevelsIdsCSV    mediumtext   not null,
    UseParamCache        tinyint      not null,
    VerboseCast          tinyint      not null,
    DefaultZone          mediumtext   not null
)
    engine = MyISAM
    charset = utf8;

